public DateCalc(final SchemaField f,
                final Date now) {
  super(f);
  this.now = now;
  if (! (field.getType() instanceof TrieDateField) ) {
    throw new IllegalArgumentException("SchemaField must use field type extending TrieDateField or DateRangeField");
  }
}

